import './App.css';

function AppBlackWings() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input
        type='submit'
        value="Continuar" 
        onClick={location.href="../public/promos.html"}/>
        <br></br>
        <br></br>
        <p>Datos de la empresa:</p>
        <p>Dirección: C. Ramón Castellanos 828</p>
        <p>Horario Sabados: 19:00 p.m. a 23:00 p.m. </p>
        <p>Telefono: 33-1173-3605 </p>
      </header>
    </div>
  );
}

export default AppBlackWings;
